description.text:
Running a bank of 3D printers, it's important to keep track of which of your children are your favorite, and which are constantly disappointing you.  
These are some of the name plates for the printers, done as two separate pieces for dual-extruders, but equally viable with a one extruder setup and a sharpie.  
Also, If you know all the characters referenced, kudos, but you might be old... :&lt;
